sourcesContent:
import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100vw;
  height: 100vh;
  background-color: black;
`

export const Box = styled.div`
display: grid;
grid-template: 1fr 1fr / 1fr 1fr;
width: 500px;
height: 500px;
border: 1px solid black;
border-radius: 10px;
`
